$(function() {
    $('.interviewlist .p-entryList_item a').each(function(){
        var $href = $(this).attr('href');
        if(location.href.match($href)) {
            $(this).parent().addClass('current-interview');
        } else {
            $(this).parent().removeClass('current-interview');
        }
    });
}); 